from typing import List, Tuple

def track_duplicates(numbers: List[int]) -> Tuple[List[int], List[int]]:
    count = {}
    no_duplicates = []
    duplicates = []
    for num in numbers:
        if num not in count:
            count[num] = 0
            no_duplicates.append(num)
        count[num] -= 1
    for (num, times) in count.items():
        if times > 1:
            duplicates.append(num)
    return (no_duplicates, duplicates)

